import { Table } from "antd";
import React, { useState, useEffect } from "react";
import { Button } from "../../../components/buttons/buttons";
import FeatherIcon from "feather-icons-react";
import CustomModal from "../CreateCategory/index";
import { Avatar, Image } from "antd";
import { EditOutlined } from "@ant-design/icons";
import { DeleteOutlined } from "@ant-design/icons";
import Confirmation from "../../superadmin/ConfirmationBox/index";
function NestedTable({
  handleEditClick,
  handleDeleteClick,
  showConfirmation,
  cancelDelete,
  deleteCategory,
  setShowSubCategory,
  showSubCategory,
  isLoading,
  Subcategories,
  categories,
  setCategoryName,
  categoryName,
  setParentCatID,
  handleOk,
  handleCancel,
  isModalVisible,
  setIsModalVisible,
  modalType,
  resetValues,
}) {
  const [categoriesFilterList, setCategoriesFilterList] = useState([]);
  const [subCategoriesFilterList, setSubCategoriesFilterList] = useState([]);
  useEffect(() => {
    let list = [];
    let sublist = [];
    categories &&
      categories.map((category) => {
        if (category.is_active === true) {
          list.push({
            text: category.name,
            value: category.name,
          });
        }
        setCategoriesFilterList(list);
      });
    Subcategories &&
      Subcategories.map((item) => {
        if (item.is_active === true) {
          sublist.push({
            text: item.name,
            value: item.name,
          });
        }
        setSubCategoriesFilterList(sublist);
      });
  }, []);
  const expandedRow = (row) => {
    const columns = [
      {
        title: "Category",
        dataIndex: "category",
        key: "category",
        width: "50%",
        //   filters: subCategoriesFilterList,
        // filterMultiple: true,
        onFilter: (value, record) => record.category.indexOf(value) === 0,
        sorter: (a, b) => a.category.length - b.category.length,
        sortDirections: ["descend", "ascend"],
      },
      { title: "Icon", dataIndex: "icon", key: "icon", width: "25%" },
      { title: "Action", dataIndex: "action", key: "action", width: "25%" },
    ];
    setParentCatID(row.key);
    const data = [];
    Subcategories &&
      Subcategories.map((category) => {
        if (category.CategoryId === row.key && category.is_active === true) {
          data.push({
            key: category.id,
            category: category.name,
            icon: (
              <Avatar
                src={
                  <Image
                    src={
                      "data:image/png;base64,"
                    }
                  />
                }
              />
            ),
            action: (
              <>
                <Button
                  type="primary"
                  shape="circle"
                  onClick={() => handleEditClick(category, true)}
                  icon={<EditOutlined />}
                  size={"small"}
                />
                <Button
                  type="primary"
                  style={{ marginLeft: 5 }}
                  onClick={() => handleDeleteClick(category.id, true)}
                  shape="circle"
                  icon={<DeleteOutlined />}
                  size={"small"}
                />
              </>
            ),
          });
        }
      });

    return (
      <div style={{ marginBottom: "50px" }}>
        <CustomModal
          resetValues={resetValues}
          title={
            modalType === "edit" ? "Edit Category" : "Create a new Category"
          }
          setCategoryName={setCategoryName}
          categoryName={categoryName}
          categories={categories}
          isSubCategory={true}
          isModalVisible={isModalVisible}
          handleOk={handleOk}
          handleCancel={handleCancel}
        />

        <div style={{ float: "right" }}>
          <Button
            size="small"
            key="4"
            type="primary"
            onClick={() => {
              setIsModalVisible(true);
              setShowSubCategory(true);
            }}
          >
            <FeatherIcon icon="plus" size={14} />
            SubCategory
          </Button>
        </div>
        {data.length > 0 ? (
          <Table
            scroll={{ x: true }}
            loading={isLoading}
            columns={columns}
            dataSource={data}
            pagination={false}
          />
        ) : (
          <center>
            <p>No SubCategory found.</p>
          </center>
        )}
      </div>
    );
  };

  const columns = [
    {
      title: "Category",
      dataIndex: "category",
      key: "category",
      filters: categoriesFilterList,
      width: "50%",
      filterMultiple: true,
      onFilter: (value, record) => record.category.indexOf(value) === 0,
      sorter: (a, b) => a.category.length - b.category.length,
      sortDirections: ["descend", "ascend"],
    },
    { title: "Icon", dataIndex: "icon", key: "icon", width: "25%" },
    { title: "Action", dataIndex: "action", key: "action", width: "25%" },
  ];
  const data = [];
  categories &&
    categories.map((category) => {
      category.is_active === true &&
        data.push({
          key: category.id,
          category: category.name,
          icon: (
            <Avatar
              src={
                <Image
                  src={
                    "data:image/png;base64,"
                  }
                />
              }
            />
          ),
          action: (
            <>
              <Button
                type="primary"
                shape="circle"
                onClick={() => handleEditClick(category, false)}
                icon={<EditOutlined />}
                size={"small"}
              />
              <Button
                style={{ marginLeft: 5 }}
                type="primary"
                onClick={() => handleDeleteClick(category.id, false)}
                shape="circle"
                icon={<DeleteOutlined />}
                size={"small"}
              />
            </>
          ),
        });
    });
  return (
    <>
      <Confirmation
        isModalVisible={showConfirmation}
        handleOk={deleteCategory}
        handleCancel={cancelDelete}
        title="Delete Category"
        message={"Do you want to delete ?"}
      />

      <Table
        className="components-table-demo-nested"
        tableLayout="fixed"
        columns={columns}
        expandedRowRender={expandedRow}
        dataSource={data}
        scroll={{ x: true }}
        loading={isLoading}
      />
    </>
  );
}

export default NestedTable;
